import React from 'react';
import {connect} from 'react-redux';

const BookGalleryComponent=(props)=>{
    return(
        <div>
            <ul>
                {props.bookList.map(bookItem => {
                    <li key={bookItem.id}>
                        bookItem.bookName
                    </li>    
                })}
            </ul>
        </div>
    )
}

function mapStateToProps(state){
    let {bookList}=state;
    return {
        bookList
    }
}

export default connect()(BookGalleryComponent)
